// src/services/GiphyService.js
import axios from 'axios';

const API_URL = '/api'; // This will use the proxy

export default {
  async searchGifs(query, limit = 20) {
    try {
      const response = await axios.get(`${API_URL}/Giphy/SearchGifs`, {
        params: { query, limit }
      });
      return response.data;
    } catch (error) {
      throw error;
    }
  }
};
